import React from 'react';

const InvoiceInfo = ({invoice,setShowInvoices}) => {
    console.log('invoice bill', invoice)
    return (
        <div className={'invoice-info-wrapper'}>


            <div className="content">
                <div className="header">

                    <h3 className={'invoice-id'}> #{invoice.id}</h3>
                    <h2 className={'close'} onClick={() =>{setShowInvoices(false)}}> X</h2>

                </div>
                <h3 className="invoice-patient">patient name</h3>
                <h6>patient mobile</h6>
                <h6>issued at </h6>
                <h6>description</h6>
                <h6>treatment</h6>
                <h6>amountPayed</h6>
                <h6>charged</h6>
                <h6>dueAmount</h6>
            </div>

            <div className='background'></div>

        </div>
    );
};

export default InvoiceInfo;
